import React, { useEffect, useState } from 'react';
import './Hero.css';

const Hero = () => {
  const [text, setText] = useState('');
  const [isDeleting, setIsDeleting] = useState(false);
  const [loopNum, setLoopNum] = useState(0);
  const [typingSpeed, setTypingSpeed] = useState(150);

  const roles = ['Computer Science Student', 'Full Stack Developer', 'Problem Solver', 'Tech Enthusiast'];

  useEffect(() => {
    const handleType = () => {
      const current = loopNum % roles.length;
      const fullText = roles[current];

      setText(isDeleting 
        ? fullText.substring(0, text.length - 1)
        : fullText.substring(0, text.length + 1)
      );

      setTypingSpeed(isDeleting ? 30 : 150);

      if (!isDeleting && text === fullText) {
        setTimeout(() => setIsDeleting(true), 500);
      } else if (isDeleting && text === '') {
        setIsDeleting(false);
        setLoopNum(loopNum + 1);
      }
    };

    const timer = setTimeout(handleType, typingSpeed);
    return () => clearTimeout(timer);
  }, [text, isDeleting, loopNum, typingSpeed, roles]);

  const scrollToProjects = () => {
    const element = document.getElementById('projects');
    if (element) {
      element.scrollIntoView({ behavior: 'smooth' });
    }
  };

  const scrollToContact = () => {
    const element = document.getElementById('contact');
    if (element) {
      element.scrollIntoView({ behavior: 'smooth' });
    }
  };

  return (
    <section id="home" className="hero">
      <div className="hero-container">
        <div className="hero-content">
          <div className="hero-text">
            <h1 className="hero-title">
              Hi, I'm <span className="name-highlight">Your Name</span>
            </h1>
            <div className="hero-subtitle">
              <span className="typing-text">{text}</span>
              <span className="cursor">|</span>
            </div>
            <p className="hero-description">
              Passionate about creating innovative solutions through code. 
              Currently pursuing Computer Science and building amazing projects 
              that solve real-world problems.
            </p>
            <div className="hero-buttons">
              <button className="btn btn-primary" onClick={scrollToProjects}>
                View My Work
              </button>
              <button className="btn btn-secondary" onClick={scrollToContact}>
                Get In Touch
              </button>
            </div>
          </div>
          <div className="hero-visual">
            <div className="code-animation">
              <div className="code-line">
                <span className="code-keyword">const</span>
                <span className="code-variable"> developer</span>
                <span className="code-operator"> = </span>
                <span className="code-string">"passionate"</span>
                <span className="code-punctuation">;</span>
              </div>
              <div className="code-line">
                <span className="code-keyword">function</span>
                <span className="code-function"> createSolutions</span>
                <span className="code-punctuation">() {'{'}</span>
              </div>
              <div className="code-line code-indent">
                <span className="code-keyword">return</span>
                <span className="code-string"> "innovation"</span>
                <span className="code-punctuation">;</span>
              </div>
              <div className="code-line">
                <span className="code-punctuation">{'}'}</span>
              </div>
            </div>
          </div>
        </div>
        <div className="hero-scroll">
          <div className="scroll-indicator">
            <span>Scroll Down</span>
            <div className="scroll-arrow"></div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Hero;
